import React from 'react';

const TarefaLista = () => {
    const tarefas = [
        { descricao: 'Tarefa 1', concluida: false },
        { id: 2, descricao: 'Tarefa 2', concluida: true },
        { id: 3, descricao: 'Tarefa 3', concluida: false }
    ];

    return (
        <table>
            <tbody>
                {tarefas.map(tarefa => (
                    <tr key={tarefa.id}>
                        <td>{tarefa.descricao}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    );
};

export default TarefaLista;
